import React, { Component } from "react";
import styled from "styled-components";

// import Logo from "./Logo";
// import Links from "./Links";

const Link = styled.a.attrs({
  className:
    "text-sm font-bold leading-relaxed inline-block mr-4 py-2 whitespace-no-wrap uppercase text-white",
});

export default function NavBar() {
  const [navBarOpen, setNavBarOpen] = React.useState(false);
  return (
    <>
      <nav className="relative flex flex-wrap ites-center justify-between px-2 py-3 navbar-expand-lg bg-red-50 mb-3">
        <div className="container px-4 mx-auto flex flex-wrap items-center justify-between">
          <div className="w-full relative flex justify-between lg:w-auto lg:static lg:block lg:justify-start"></div>
        </div>
      </nav>
    </>
  );
}
